" أي لتتحولنّ من حال إلى حال، فالدنيا لا تثبت، والإنسان عليه أن لا يفتن في الرخاء وأن يكثر الطاعات، ولا ييأس في الشدة بأن يصبر ويحتسب.
ربِ اجعل لنا في كل طبق نركبه خيرًا وفيرًا، وهونًا وتيسيرًا، ورُقيًّا يدنينا منك ويجعلنا كما تُحِب ونُحِب."💛
